// 注册窗口
$(document).on('click','.register-choose', function(e) {
  try {
    SSwal.close()
  } catch (e) {
  }
  SSwal.fire({
    title: "免费注册",         
    showCancelButton: true,
    confirmButtonText: '注册',
    cancelButtonText: '取消',
    html: $('.accordion_register').html(),
    preConfirm:(e)=>{
      let content = SSwal.getContent()
      let $$$ = content.querySelector.bind(content)
      let account = $$$('input[name=register_account]').value
      let email = $$$('input[name=register_email]').value
      let password = $$$('input[name=register_password]').value
      let passwordCheck = $$$('input[name=register_password_check]').value
      let code = $$$('input[name=register_code]').value
      if(!account){
        new Noty({
          layout:'topCenter',
          theme: 'bootstrap-v4',
          text: '账号不能为空!',
          progressBar:false,
          timeout:1000
        }).show().setType('warning');
        return false;
      }
      if(email){
        // 邮箱校验
        var reg = /\w+([-+.]\w+)*@\w+([-.]\w+)*\.\w+([-.]\w+)*/;
        let isok= reg.test(email);
        if(!isok) {
          new Noty({
            layout:'topCenter',
            theme: 'bootstrap-v4',
            text: '邮箱格式不正确!',
            progressBar:false,
            timeout:1000
          }).show().setType('warning');
          return false;
        }
      }
      if(!password){
        new Noty({
            layout:'topCenter',
            theme: 'bootstrap-v4',
            text: '密码不能为空!',
            progressBar:false,
            timeout:1000
        }).show().setType('warning');
        return false;
      }
      if(password.length < 6){
        new Noty({
            layout:'topCenter',
            theme: 'bootstrap-v4',
            text: '密码长度不低于6位数!',
            progressBar:false,
            timeout:1000
        }).show().setType('warning');
        return false;
      }
      if(!passwordCheck){
        new Noty({
            layout:'topCenter',
            theme: 'bootstrap-v4',
            text: '确认密码不能为空!',
            progressBar:false,
            timeout:1000
        }).show().setType('warning');
        return false;
      }
      if(passwordCheck != password){
        new Noty({
            layout:'topCenter',
            theme: 'bootstrap-v4',
            text: '两次密码不同!',
            progressBar:false,
            timeout:1000
        }).show().setType('warning');
        return false;
      }
      if(!code){
        new Noty({
            layout:'topCenter',
            theme: 'bootstrap-v4',
            text: '请输入验证码!',
            progressBar:false,
            timeout:1000
        }).show().setType('warning');
        return false;
      }

      $.ajax({
        url: '/personal/register',
        data:{account:account,email:email,password:password,code:code},
        type:'POST',
        success:function(res){
          console.log(res);
          if(res.code == 200){
            new Noty({
              layout:'topCenter',
              theme: 'bootstrap-v4',
              text: res.msg,
              progressBar:false,
              timeout:1000
            }).show().setType('success');
            SSwal.close()
          } else {
            new Noty({
              layout:'topCenter',
              theme: 'bootstrap-v4',
              text: res.msg,
              progressBar:false,
              timeout:1000
            }).show().setType('warning');
            return false;
          }
        }
      })
      return false;
    },
    onClose: () => {
    }
  })
})
